  const rows = Array(fieldSize.height)
    .fill(Array(fieldSize.width).fill(''))
    .map((row, index) => (
    <Row key={`row${index}`} content={row} number={index} />)
  );

  return (
    <section>
      {rows}
    </section>
  )
};

export default Game;
